                    "contentId": Confluence.getContentId(),
                    "contentType": Meta.get('content-type'),
                    "spaceKey": Meta.get('space-key'),
                    "xHtml": editor.getContent(),
                    "outputType": Confluence.Editor.PREVIEW_OUTPUT_TYPE
