        dragTarget.attr('style', dragOrigStyle);
        cm.replaceWith(dragTarget);
        cm.destroy();
        dragTarget = null;
        cm = null;

        removeTableSelection();

        editor.undoManager.add();
        AJS.trigger('synchrony.start', { id: synchronyId });
