    function cancelMove(e) {
        scroller.cancelScrolling();
        editorDoc.unbind('.moveable-zone');
        editor.undoManager.undo();
        editor.selection.select(dragTarget[0]);
        editor.selection.collapse(false);
        dragTarget = null;
    }

    function bindMove() {
        editorDoc.delegate(MOVE_SELECTOR, {
            mousedown: startMove
        });
    }

    function ignore(e) {
        e.preventDefault();
    }

