            var vp = tinyMCE.DOM.getViewPort(tinyMCE.activeEditor.getWin());
            var selection;
            var rng;
            var rngCopy;

            // The editor (iframe) should be given focus at this point to ensure browsers (like IE8) can retrieve the selection.
